document.getElementById('colorstrip').addEventListener('click', printPosition)
document.getElementById('colorstrip').addEventListener('mousemove', colorstripMouseover)
document.getElementById('webviewcontainer').addEventListener('click', clearWebview)


function getPosition(e) {
  var rect = e.target.getBoundingClientRect();
  var x = Math.floor(e.clientX - rect.left);
  var y = Math.floor(e.clientY - rect.top);
  return {
    x,
    y
  }
}

function colorstripMouseover(e) {
  if (document.getElementById('webview').src == "about:blank") {
      changeBackgroundColor(e);
   };
}

function changeBackgroundColor(e) {
   var position = getPosition(e);
   var color = colorlist[position.x];
   var rgbcolor = "rgb(" + color[0] + ", " + color[1] + ", " + color[2] + ")"
   document.body.style.backgroundColor = rgbcolor;
   document.body.style.scrollbarTrackColor = rgbcolor;
}
  
function printPosition(e) {
  changeBackgroundColor(e);
  var position = getPosition(e);
  var artwork = artworklist[position.x];
  var url = 'https://www.sfmoma.org/artwork/' + artwork;
  document.getElementById('webview').src = url;

}

function clearWebview() {
  document.getElementById('webview').src = "about:blank";
}
